import{_ as e,o as a,c as i,Q as s}from"./chunks/framework.a7175731.js";const l="/assets/image-20231106162350103.6fdcb2e6.png",t="/assets/image-20231106173625977.6e53cdc3.png",o="/assets/image-20231106180404277.b30608f5.png",r="/assets/image-20231106173726918.5c198930.png",p="/assets/image-20231106182411648.4dd36841.png",c="/assets/image-20231106182732062.a7ef937c.png",m="/assets/image-20231106183634841.34a696ae.png",n="/assets/image-20231106183651254.9742b4d6.png",g="/assets/image-20231106183737684.a1957b9a.png",u="/assets/image-20231106183826378.ae05509e.png",d="/assets/image-20231106183208018.c29fde26.png",_="/assets/image-20231106183229578.798a19f6.png",h="/assets/image-20231106183338497.239916b4.png",b="/assets/image-20231106183448057.a73310dd.png",I=JSON.parse('{"title":"Geoserver 发布WMTS --笔记","description":"","frontmatter":{},"headers":[],"relativePath":"GIS/OGC服务/GeoserverWMTS.md","filePath":"GIS/OGC服务/GeoserverWMTS.md","lastUpdated":null}'),f={name:"GIS/OGC服务/GeoserverWMTS.md"},S=s('<h1 id="geoserver-发布wmts-笔记" tabindex="-1">Geoserver 发布WMTS --笔记 <a class="header-anchor" href="#geoserver-发布wmts-笔记" aria-label="Permalink to &quot;Geoserver 发布WMTS --笔记&quot;">​</a></h1><blockquote><p>数据准备：china3857</p><p>链接：<a href="https://pan.baidu.com/s/1r6qrMjJ5m-_5b94_nPVHFA" target="_blank" rel="noreferrer">https://pan.baidu.com/s/1r6qrMjJ5m-_5b94_nPVHFA</a> 提取码：4kp4</p></blockquote><h2 id="一、创建工作空间" tabindex="-1">一、创建工作空间 <a class="header-anchor" href="#一、创建工作空间" aria-label="Permalink to &quot;一、创建工作空间&quot;">​</a></h2><ul><li>命名自定义 <ul><li><code>tigerspace</code></li></ul></li><li>命名空间URI 自定义 <ul><li><code>http://localhost:7080/geoserver/tigerspace</code></li></ul></li></ul><p>💡 设置完成后返回工作空间，勾选需要的服务，这里默认将四个服务全部勾选</p><p><img src="'+l+'" alt="image-20231106162350103"></p><h2 id="二、创建存储仓库" tabindex="-1">二、创建存储仓库 <a class="header-anchor" href="#二、创建存储仓库" aria-label="Permalink to &quot;二、创建存储仓库&quot;">​</a></h2><ol><li>选择栅格数据集下的GeoTiff（视情况而定）</li><li>数据源名称 和 说明自定义</li><li>连接参数找到对应影像位置即可</li></ol><p><img src="'+t+'" alt="image-20231106173625977"></p><h2 id="三、创建网格集-或者-用已有的切片方案" tabindex="-1">三、创建网格集 或者 用已有的切片方案 <a class="header-anchor" href="#三、创建网格集-或者-用已有的切片方案" aria-label="Permalink to &quot;三、创建网格集 或者 用已有的切片方案&quot;">​</a></h2><ul><li>找到网格集，添加新网格集（如有需要）</li></ul><p><img src="'+o+'" alt="image-20231106180404277"></p><ul><li>不需要的话用已有的切片网格集即可</li></ul><p><img src="'+r+'" alt="image-20231106173726918"></p><h2 id="四、对影像进行切片" tabindex="-1">四、对影像进行切片 <a class="header-anchor" href="#四、对影像进行切片" aria-label="Permalink to &quot;四、对影像进行切片&quot;">​</a></h2><ul><li>找到切片图层，选择对应的切片图层，点击Seed/Truncate</li></ul><p><img src="'+p+'" alt="image-20231106182411648"></p><ul><li>设置切片参数，其中大部分参数不用修改，注意以下几个即可 <ul><li>Type of operation <ul><li>Seed - generate missing tiles 默认选项，会自动生成缺失的瓦片，适合全部生成 和 缺失的瓦片 👍</li></ul></li><li>Zoom start <ul><li>最小级别数</li></ul></li><li>Zoom stop <ul><li>最大级别数</li></ul></li></ul></li></ul><p>设置完成后，最后点击最下方的Submit即可</p><p><img src="'+c+'" alt="image-20231106182732062"></p><p>查看切好的瓦片</p><p><img src="'+m+'" alt="image-20231106183634841"></p><p><img src="'+n+'" alt="image-20231106183651254"></p><p>💡 补充切片方案</p><p>geoserver采用的osgeo的切片方案</p><p><img src="'+g+'" alt="image-20231106183737684"></p><p>补充其他，如<em>Google、Open Street Maps、ESRI</em> 使用的另一套切片方案</p><p><img src="'+u+'" alt="image-20231106183826378"></p><h2 id="五、发布图层" tabindex="-1">五、发布图层 <a class="header-anchor" href="#五、发布图层" aria-label="Permalink to &quot;五、发布图层&quot;">​</a></h2><p>找到刚才的仓库图层，大部分参数默认即可，注意以下几处</p><ul><li><code>坐标参考系统</code>：更改为默认shp的坐标系（默认情况下Geoserver会自动读取shp的坐标系），之后SRS处理设置为强制声明</li><li><code>边框</code>：根据需求指定 <ul><li>Native Bounding Box <ul><li>从数据中计算：选取数据本身的上下左右做边界</li><li>compute from SRS bounds：把整个对应坐标系的边界作为边界</li></ul></li><li>纬度/经度边框 <ul><li>compute from native bounds：把整个对应坐标系的边界作为边界</li></ul></li></ul></li><li>Tile Caching <ul><li>这里采用Geoserver自带的网格集切片方案，WorldMercatorWGS84Quad</li></ul></li></ul><p>最后保存即可。</p><p><img src="'+d+'" alt="image-20231106183208018"></p><p><img src="'+_+'" alt="image-20231106183229578"></p><h2 id="六、图层预览" tabindex="-1">六、图层预览 <a class="header-anchor" href="#六、图层预览" aria-label="Permalink to &quot;六、图层预览&quot;">​</a></h2><p>​ - 找到切片图层，选择 jpeg 或者 png查看即可</p><p><img src="'+h+'" alt="image-20231106183338497"></p><p><img src="'+b+'" alt="image-20231106183448057"></p>',38),q=[S];function G(v,T,k,P,x,M){return a(),i("div",null,q)}const C=e(f,[["render",G]]);export{I as __pageData,C as default};
